const App = () => {
    let time = new Date().toLocaleTimeString();

    let [currTime, setTime] = useState(time);

    const getTime = () => {
        // setTime(new Date().toLocaleTimeString());
        time = new Date().toLocaleTimeString();
        setTime(time);
    }

    return (
        <>
            <h1> {currTime} </h1>
        </>
    );
}

export default App;
